import React, { useState } from "react";
import "./App.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import Home from "./Home";
import Calendar from "./Calendar";
import Day from "./Day";
import Form from "./Form";

import generateRandomAppointments from "./utils/utils"
const appointments = generateRandomAppointments(150);

function App() {

  const [appointment, setAppointments] = useState({ appointments });
  const [patients, setPatients] = useState({ appointments });

  const makeSick = (employee) => {
    console.log('You clicked submit.');
    console.log(employee);
    // setEmployee(employee.sick = true);
    // console.log(employee);
};

  const addPatient = (firstName, lastName, phoneNumber, emailAddress) => {
    setPatients([
      ...patients,
      {
        id: patients.length + 1,
        firstName,
        lastName,
        phoneNumber,
        emailAddress
      }
    ])
  }

  return (
    < Router >
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/calendar">Calendar view</Link>
            </li>
            <li>
              <Link to="/day">Day view</Link>
            </li>
            <li>
              <Link to="/form">Form to change the calendar</Link>
            </li>
          </ul>
        </nav>

        <main>
          <Switch>
            <Route path="/calendar">
              <Calendar appointments={appointments} />
            </Route>
            <Route path="/day">
              <Day appointments={appointments.filter(app => app.day === 1)} />
            </Route>
            <Route path="/form">
              <Form appointments={appointments} addPatient={addPatient} makeSick={makeSick}/>
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </main>
      </div>
    </Router >
  )
}
export default App;
